import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import Container from "@material-ui/core/Container";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
import {useStyles} from "./Layouts/LayoutUseStyles";
import CssBaseline from "@material-ui/core/CssBaseline";
import Divider from "@material-ui/core/Divider";
import {MuiThemeProvider} from "@material-ui/core";
import createMuiTheme from "@material-ui/core/styles/createMuiTheme";
import useMediaQuery from "@material-ui/core/useMediaQuery";

function Copyright() {
    return (
        <Typography variant="body2" color="textSecondary">
            {'Copyright © '}

            <span>Artworch</span>{' '}

            {new Date().getFullYear()}
            {'.'}
        </Typography>
    );
}

const prefersDarkMode = useMediaQuery('(prefers-color-scheme: dark)');

const theme = React.useMemo(
    () =>
        createMuiTheme({
            palette: {
                type: prefersDarkMode ? 'dark' : 'light',
            },
        }),
    [prefersDarkMode],
);

// const theme = createMuiTheme({
//     palette: {
//         type: "dark",
//     },
//     overrides: {
//         MuiCssBaseline: {
//             '@global': {
//                 body: {
//                     background: 'linear-gradient(to right bottom, #2c3e50, #95a5a6)',
//                 }
//             }
//         }
//     },
// });

export default function Home() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <MuiThemeProvider theme={theme} color="secondary">
                <CssBaseline/>
            </MuiThemeProvider>

            <div className={classes.wrapper}>
                <div className={classes.content}>
                    <div>
                        <h1>artworch</h1>
                    </div>
                    <Divider variant="middle"/>
                    <main>
                        <div>

                        </div>
                    </main>
                </div>
                <footer className={classes.footer}>
                    <Container maxWidth="sm">
                        <Box display="flex" justifyContent="center" alignItems="center">
                            <Typography variant="body1"><q>sell your cleverness and buy bewilderment</q>&ndash;
                                <cite>Rumi</cite>.
                            </Typography>
                        </Box>
                    </Container>
                    <Container maxWidth="sm">
                        <Box display="flex" justifyContent="center" alignItems="center">
                            <Copyright/>
                        </Box>
                    </Container>
                </footer>
            </div>
        </div>
    );
}
